// src/components/BookReader.js
import React from 'react';

const BookReader = ({ match }) => {
    const { bookTitle } = match.params;

    return (
        <div className="book-reader">
            <h2>{bookTitle}</h2>
            <iframe
                src={`https://ccel.org/ccel/lawrence/practice/practice.i.html`}
                title={bookTitle}
                width="100%"
                height="600px"
                style={{ border: 'none' }}
            />
        </div>
    );
};

export default BookReader;
